When in Rome 2010

Verenigde Staten
Romantiek / Komedie
91 minuten

geregisseerd door Mark Steven Johnson
met Kristen Bell, Josh Duhamel en Danny DeVito

Beth Harper (Kristen Bell) is een jonge, ambitieuze New Yorker. 
Het enige probleem is haar complete ongeluk in de liefde. Maar 
wanneer Beth voor de bruiloft van haar zus naar Rome reist, 
steelt ze munten uit 'de fontein der liefde'. Dit heeft als gevolg 
dat ze vanaf dat moment continue achtervolgd wordt door verschillende 
mannen die haar geliefde willen zijn.


